script: |
  super -f text -I q894.spq | sort > q894.out

inputs:
  - name: q894.spq
    data: |
      SELECT DISTINCT col0 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT + + col1 + + + col0 NOT BETWEEN + - col2 AND - - col0 * + + col2 + col0;
  - name: tab2

outputs:
  - name: q894.out
    data: |
      46
      64
      75
